import React from "react";
import { BrowserRouter as Router, Routes, Route, useNavigate } from "react-router-dom";
import { Provider } from "react-redux";
import store from "./store";
import Header from "./components/Layout/Header";
import Departments from "./components/Departments";
import AddDepartment from "./components/departments/AddDepartment";
import UpdateDepartment from "./components/departments/UpdateDepartment";
import DepartmentBoard from "./components/DepartmentBoard";
import AddEmployee from "./components/employees/AddEmployees";
import UpdateEmployee from "./components/employees/UpdateEmployees";
import EmployeeBoard from "./components/EmployeeBoard";
import AddTaskForm from "./components/tasks/AddTaskForm";
import UpdateTask from "./components/tasks/UpdateTask";
import Landing from "./components/Landing";
import Login from "./components/LogIn";
import Register from "./components/Register";

// Define your authentication logic here
function checkAuthentication() {
  // Replace this with your actual authentication logic
  // For example, check if a user is logged in or has a valid token.
  // Return true for authenticated users, false otherwise.
  return /* Your authentication logic here */;
}

// Custom PrivateRoute component
function PrivateRoute({ element, ...rest }) {
  const navigate = useNavigate();

  if (!checkAuthentication()) {
    navigate("/login");
    return null; // Return nothing if not authenticated
  }

  return <Route {...rest} element={element} />;
}

function App() {
  return (
    <Provider store={store}>
      <Router>
        <div>
          {/* Render the Header for all routes except Landing, Login, and Register */}
          <Header />
          <Routes>
            <Route path="/" element={<Landing />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/departments" element={<PrivateRoute element={<Departments />} />} />
            <Route path="/addDepartment" element={<PrivateRoute element={<AddDepartment />} />} />
            <Route path="/updateDepartment/:id" element={<PrivateRoute element={<UpdateDepartment />} />} />
            <Route path="/employees/:id" element={<PrivateRoute element={<DepartmentBoard />} />} />
            <Route path="/addEmployee/:id" element={<PrivateRoute element={<AddEmployee />} />} />
            <Route path="/updateEmployee/:dep_id/:id" element={<PrivateRoute element={<UpdateEmployee />} />} />
            <Route path="/employeeBoard/:dep_id/:emp_id" element={<PrivateRoute element={<EmployeeBoard />} />} />
            <Route path="/addTask/:dep_id/:emp_id" element={<PrivateRoute element={<AddTaskForm />} />} />
            <Route path="/updateTask/:dep_id/:emp_id/:id" element={<PrivateRoute element={<UpdateTask />} />} />
          </Routes>
        </div>
      </Router>
    </Provider>
  );
}

export default App;
